device.LPC55S69.manifest_metadata_set:
  section-type: manifest_content
  __requires__:
  - device.LPC55S69
  contents:
  - key: compatible_device.segger
    value: LPC55S69
    bindings: device.LPC55S69 core.cm33_core0
  - key: description
    bindings: device.LPC55S69
    content: The LPC55xx are ARM Cortex-M33 based microcontrollers for embedded applications.
  - key: image
    value: docs/images/device.jpg
    bindings: device.LPC55S69
  - key: href
    value: http://www.nxp.com/lpc
    bindings: device.LPC55S69
  - key: html
    bindings: device.LPC55S69
    content: The LPC55xx/LPC55Sxx is an ARM Cortex M33 based micro-controller for
      embedded applications. These devices include up to 320 KB of on-chip SRAM, up
      to 640 KB on-chip flash, high-speed and full-speed USB host and device interface
      with crystal-less operation for full-speed, five general-purpose timers, one
      SCTimer/PWM, one RTC/alarm timer, one 24-bit Multi-Rate Timer (MRT), a Windowed
      Watchdog Timer (WWDT), eight flexible serial communication peripherals (each
      of which can be a USART, SPI, I2C, or I2S interface), one 16-bit 1.0 Msamples/sec
      ADC, temperature sensor.
